   .then((res) => res.json())
   .then ((res) => {
	  setData(res)
	  console.log(res)

  })
}
  useEffect (() => {
	  getData()
   },[]);



	return (
		<div>
			{data.map((profile)=>{
			return(
				<div key={profile.id}>
					<p>{profile.title}</p>

				</div>
			)				

			})}

		</div>
	)
}

export default Main
